vec2 normz(vec2 x) {
	return x == vec2(0.0, 0.0) ? vec2(0.0, 0.0) : normalize(x);
}

// reverse advection
vec3 advect(vec2 ab, vec2 vUv, vec2 step, float sc) {

    vec2 aUv = vUv - ab * sc * step;

    const float _G0 = 0.25; // center weight
    const float _G1 = 0.125; // edge-neighbors
    const float _G2 = 0.0625; // vertex-neighbors

    // 3x3 neighborhood coordinates
    float step_x = step.x;
    float step_y = step.y;
    vec2 n  = vec2(0.0, step_y);
    vec2 ne = vec2(step_x, step_y);
    vec2 e  = vec2(step_x, 0.0);
    vec2 se = vec2(step_x, -step_y);
    vec2 s  = vec2(0.0, -step_y);
    vec2 sw = vec2(-step_x, -step_y);
    vec2 w  = vec2(-step_x, 0.0);
    vec2 nw = vec2(-step_x, step_y);

    vec3 uv =    texture(sTD2DInputs[0], fract(aUv)).xyz;
    vec3 uv_n =  texture(sTD2DInputs[0], fract(aUv+n)).xyz;
    vec3 uv_e =  texture(sTD2DInputs[0], fract(aUv+e)).xyz;
    vec3 uv_s =  texture(sTD2DInputs[0], fract(aUv+s)).xyz;
    vec3 uv_w =  texture(sTD2DInputs[0], fract(aUv+w)).xyz;
    vec3 uv_nw = texture(sTD2DInputs[0], fract(aUv+nw)).xyz;
    vec3 uv_sw = texture(sTD2DInputs[0], fract(aUv+sw)).xyz;
    vec3 uv_ne = texture(sTD2DInputs[0], fract(aUv+ne)).xyz;
    vec3 uv_se = texture(sTD2DInputs[0], fract(aUv+se)).xyz;

    return _G0*uv + _G1*(uv_n + uv_e + uv_w + uv_s) + _G2*(uv_nw + uv_sw + uv_ne + uv_se);
}

