float _K0 = CenterWeight;       // center weight
float _K1 = EdgeNeighbors;      // edge-neighbors
float _K2 = VertexNeighbors;    // vertex-neighbors
float cs = CurlScale;           // curl scale
float ls = LaplacianScale;      // laplacian scale
float ps = LaplacianDivScale;   // laplacian of divergence scale
float ds = DivScale;            // divergence scale
float dp = DivUpdateScale;      // divergence update scale
float pl = DivSmooth;           // divergence smoothing
float ad = AdvectDistScale;     // advection distance scale
float pwr = Power;              // power when deriving rotation angle from curl
float amp = Amp;                // self-amplification
float upd = UpdateSmooth;       // update smoothing
float sq2 = DiagWeight;         // diagonal weight

vec2 vUv = vUV.st;
vec2 texel = uTDOutputInfo.res.xy;

// 3x3 neighborhood coordinates
float step_x = texel.x;
float step_y = texel.y;
vec2 n  = vec2(0.0, step_y);
vec2 ne = vec2(step_x, step_y);
vec2 e  = vec2(step_x, 0.0);
vec2 se = vec2(step_x, -step_y);
vec2 s  = vec2(0.0, -step_y);
vec2 sw = vec2(-step_x, -step_y);
vec2 w  = vec2(-step_x, 0.0);
vec2 nw = vec2(-step_x, step_y);

vec3 uv =    texture(sTD2DInputs[0], fract(vUv)).xyz;
vec3 uv_n =  texture(sTD2DInputs[0], fract(vUv+n)).xyz;
vec3 uv_e =  texture(sTD2DInputs[0], fract(vUv+e)).xyz;
vec3 uv_s =  texture(sTD2DInputs[0], fract(vUv+s)).xyz;
vec3 uv_w =  texture(sTD2DInputs[0], fract(vUv+w)).xyz;
vec3 uv_nw = texture(sTD2DInputs[0], fract(vUv+nw)).xyz;
vec3 uv_sw = texture(sTD2DInputs[0], fract(vUv+sw)).xyz;
vec3 uv_ne = texture(sTD2DInputs[0], fract(vUv+ne)).xyz;
vec3 uv_se = texture(sTD2DInputs[0], fract(vUv+se)).xyz;

// uv.x and uv.y are the x and y components, uv.z is divergence 

// laplacian of all components
vec3 lapl  = _K0*uv + _K1*(uv_n + uv_e + uv_w + uv_s) + _K2*(uv_nw + uv_sw + uv_ne + uv_se);
float sp = ps * lapl.z;

// calculate curl
// vectors point clockwise about the center point
float curl = uv_n.x - uv_s.x - uv_e.y + uv_w.y + sq2 * (uv_nw.x + uv_nw.y + uv_ne.x - uv_ne.y + uv_sw.y - uv_sw.x - uv_se.y - uv_se.x);

// compute angle of rotation from curl
float sc = cs * sign(curl) * pow(abs(curl), pwr);

// calculate divergence
// vectors point inwards towards the center point
float div  = uv_s.y - uv_n.y - uv_e.x + uv_w.x + sq2 * (uv_nw.x - uv_nw.y - uv_ne.x - uv_ne.y + uv_sw.x + uv_sw.y + uv_se.y - uv_se.x);
float sd = uv.z + dp * div + pl * lapl.z;

vec2 norm = normz(uv.xy);

vec3 ab = advect(vec2(uv.x, uv.y), vUv, texel, ad);

// temp values for the update rule
float ta = amp * ab.x + ls * lapl.x + norm.x * sp + uv.x * ds * sd;
float tb = amp * ab.y + ls * lapl.y + norm.y * sp + uv.y * ds * sd;

// rotate
float a = ta * cos(sc) - tb * sin(sc);
float b = ta * sin(sc) + tb * cos(sc);


// ============
// N Buffer
// ============
vec3 abd = upd * uv + (1.0 - upd) * vec3(a,b,sd);

vec2 mousepos = vUV.st - MousePos.xy;
float mousedist = smoothstep(1,0,pow(length(mousepos*8), .25));

if (MouseClicks.x > 0.0) {
    abd.xy += (mousedist*100) * mousepos;
}

abd.z = clamp(abd.z, -1.0, 1.0);
abd.xy = clamp(length(abd.xy) > 1.0 ? normz(abd.xy) : abd.xy, -1.0, 1.0);
normals = vec4(abd, 0.0);

normals = TDOutputSwizzle(vec4(abd,1));


