// Color Buffer
// ============
vec2 uv2 = vUV.st;
vec3 c2 = texture(sTD2DInputs[0], uv2).xyz;
vec3 norm2 = normalize(c2);

vec3 div2 = vec3(0.1) * norm2.z;    
vec3 rbcol2 = 0.5 + 0.6 * cross(norm2.xyz, vec3(0.5, -0.4, 0.5));

image = vec4(rbcol2 + div2, 0.0);
